// src/components/TopNav.js
import React from 'react';
import '../styles/Common.css';
import logo from '../assets/tiktokstudio_logo.png'; // Ensure this path is correct
import userProfile from '../assets/user_profile.png'; // Ensure this path is correct

const TopNav = () => {
  return (
    <div className="top-nav">
      <img src={logo} alt="TikTok Studio" className="logo" />
      <img src={userProfile} alt="User Profile" className="user-profile-pic" />
    </div>
  );
};

export default TopNav;
